function mc(n) {
    if (n == "0") {

        if (HP == M_HP) {

            setTimeout(() => {
                LOG('')
                setTimeout(() => {
                    LOG('?')
                }, 500);
            }, 500);
        } else {
            LOG(`${Name}`)

            const magic = document.getElementById('magic')
            magic.removeAttribute('open')

            let heal
            if (MP >= 3) {
                MP -= 3
                heal = Math.floor(Math.random() * 5) + 1
                HP += heal
                if (M_HP < HP) {
                    heal -= HP - M_HP
                    HP = M_HP
                }
    
                setTimeout(() => {
                    LOG(`${heal}`)
                    setTimeout(() => {
                        reload()
                        E_Turn()
                    }, 500);
                }, 500);
    
            } else {
                setTimeout(() => {
                    LOG('MP')
                }, 500);
            }   
        }
    }
    
}

